{
    // arrange
    string snapshotName = nameof(SnapshotTests) + "." + nameof(Match_AssertSeveralFields_SuccessfulMatch);
    TestChild testChild = TestDataBuilder.TestChildJames().Build();
    TestPerson testPerson = TestDataBuilder.TestPersonMarkWalton().AddChild(testChild).Build();
    testPerson.Id = Guid.NewGuid();
    testPerson.CreationDate = DateTime.UtcNow;
    testPerson.Address.StreetNumber = -58;
    testPerson.Address.Country = null;
    testPerson.Relatives[0].Address.Plz = null;
    // act & assert
    Snapshot.Match(testPerson, snapshotName, matchOption => matchOption.Assert(fieldOption => Assert.NotEqual(Guid.Empty, fieldOption.Field<Guid>("Id"))).Assert(fieldOption => Assert.NotEqual(DateTime.UtcNow.AddSeconds(5), fieldOption.Field<DateTime>("CreationDate"))).Assert(fieldOption => Assert.Equal(-58, fieldOption.Field<int>("Address.StreetNumber"))).Assert(fieldOption => testChild.Should().BeEquivalentTo(fieldOption.Field<TestChild>("Children[3]"))).Assert(fieldOption => Assert.Null(fieldOption.Field<TestCountry>("Address.Country"))).Assert(fieldOption => Assert.Null(fieldOption.Field<TestCountry>("Relatives[0].Address.Plz"))));
}

